package cmd

import (
	"fmt"
	"os"
	"time"

	"github.com/fatih/color"
	"github.com/spf13/cobra"
)

var devCmd = &cobra.Command{
	Use:   "dev",
	Short: "Run application in a developer mode.",
	Long: `Run application in a developer mode.
Application will be started in a development mode on the cluster.`,
	Run: func(cmd *cobra.Command, args []string) {
		if _, err := os.Stat("devfile.yaml"); os.IsNotExist(err) {
			color.Green("There is no devfile.yaml in the current directory.")
			devfileName, devfileRegistry, projectName := SelectDevfileAlizer(cmd)
			DownloadDevfile(devfileName, devfileRegistry, projectName, "")
		} else {
			color.Green("Using devfile.yaml from the current directory.")
		}

		color.Green("Starting your application on cluster in developer mode ...")
		Spinner("Waiting for Kubernetes resources ...", 2) // creates everything on the cluster and waits for contaiers
		Spinner("Syncing files into the container ...", 2) // push the files into the container
		fmt.Println()
		color.New(color.Bold).Println("Building application using 'mvn-package' command 'mvn -Dmaven.repo.local=/home/user/.m2/repository package' ...")
		time.Sleep(time.Second * 5)
		buildLog()
		color.New(color.Bold).Println("Starting the application using 'run' command 'java -jar target/*.jar'")
		time.Sleep(time.Second * 5)
		color.Green("Your application is running on cluster. ")
		color.New(color.Bold).Println("Last 10 lines of the application log ...")
		runLog(10)

		fmt.Println()
		color.New(color.FgGreen).Println("You can access it at:")
		color.New(color.FgGreen).Print("  - ")
		color.New(color.FgGreen).Add(color.Underline).Println("http://localhost:3300")
		color.New(color.FgGreen).Print("  - ")
		color.New(color.FgGreen).Add(color.Underline).Println("http://localhost:3000")
		fmt.Println()

		color.New(color.Bold).Println("Press Ctrl+c to exit and clean up resources from cluster.")
		fmt.Println()
		Spinner("Watching for changes in the current directory ...", 5)
		fmt.Println("Change in main.java detected.")
		Spinner("Syncing files into the container ...", 2)
		Spinner("Reloading application ...", 2)
		fmt.Println()
		color.New(color.Bold).Println("Press Ctrl+c to exit and clean up resources from cluster.")
		fmt.Println()
		Spinner("Watching for changes in the current directory ...", 10)
		color.New(color.Bold).Println("Ctrl+c pressed!")
		Spinner("Cleaning up...", 2)

	},
}

func init() {

	rootCmd.AddCommand(devCmd)
}

